  "terms_content": "<h2> Όροι και Προϋποθέσεις για τον Ιστότοπο και την Εφαρμογή Ηλεκτρονικών Πληροφοριών Προϊόντος του Ομίλου PharmaLedger </h2><p>Έχοντας πρόσβαση και χρησιμοποιώντας τον Ιστότοπο και την Εφαρμογή Ηλεκτρονικών Πληροφοριών Προϊόντος του Ομίλου PharmaLedger (οι \"Υπηρεσίες\"), συμφωνείτε ότι δεσμεύεστε από αυτούς τους όρους και προϋποθέσεις (οι \"Όροι\"). Δεν μπορείτε να έχετε πρόσβαση ή να χρησιμοποιήσετε τις Υπηρεσίες αν δεν συμφωνήσετε με αυτούς τους Όρους. Οι Υπηρεσίες χειρίζονται από τον Όμιλο PharmaLedger (ο \"Όμιλος\") και προορίζονται για χρήση από άτομα που αναζητούν πληροφορίες σχετικά με τη φαρμακευτική τους αγωγή. Ένα πολυμερές δίκτυο παρέχει τις Υπηρεσίες και ο παρασκευαστής του φαρμάκου σας παρέχει τις πληροφορίες του προϊόντος που εμφανίζονται μέσω των Υπηρεσιών. Ο Όμιλος ενεργεί ως υπεύθυνος επεξεργασίας δεδομένων για αυτές τις πληροφορίες. </p><h2>Χρήση των Υπηρεσιών </h2><p>Συμφωνείτε στη χρήση των Υπηρεσιών μόνο για νόμιμους σκοπούς, και με τρόπο που δεν παραβιάζει τα δικαιώματα, ή περιορίζει ή εμποδίζει τη χρήση και την ευχαρίστηση των Υπηρεσιών από οποιοδήποτε τρίτο μέρος. Αυτός ο περιορισμός ή απαγόρευση, περιλαμβάνει χωρίς περιορισμό, συμπεριφορά που είναι παράνομη ή που μπορεί να παρενοχλήσει ή να προκαλέσει ανησυχία ή ενόχληση σε οποιοδήποτε άτομο και τη μετάδοση άσεμνου ή προσβλητικού περιεχομένου ή διακοπή της κανονικής ροής διαλόγου εντός των Υπηρεσιών. </p><h2>Πνευματική Ιδιοκτησία </h2><p>Το περιεχόμενο των Υπηρεσιών, συμπεριλαμβανομένου και χωρίς να περιορίζεται σε κείμενο, γραφικά, εικόνες και λογισμικό, είναι ιδιοκτησία του Ομίλου ή των τους δικαιοδόχους και τις εταιρείες-μέλη του και προστατεύεται από τους νόμους περί πνευματικής ιδιοκτησίας και άλλους νόμους περί πνευματικής ιδιοκτησίας. Δεν μπορείτε να χρησιμοποιήσετε οποιοδήποτε περιεχόμενο από τις Υπηρεσίες για οποιοδήποτε εμπορικό σκοπό χωρίς την ρητή γραπτή συγκατάθεση του Ομίλου. </p><h2>Ευθύνη</h2><p>Ο Όμιλος δεν παρέχει καμία διαβεβαίωση ή εγγυήσεις κανενός είδους, ρητές ή σιωπηρές, ως προς τη λειτουργία των Υπηρεσιών ή τις πληροφορίες, το περιεχόμενο,τα υλικά ή τα προϊόντα που περιλαμβάνονται στις Υπηρεσίες. Ο Όμιλος δε φέρει ευθύνη για οποιεσδήποτε ζημίες που προκύπτουν από τη χρήση των Υπηρεσιών, συμπεριλαμβανομένων, ενδεικτικά, άμεσες, έμμεσες, τυχαίες, ποινικές και επακόλουθες ζημίες. </p><h2>Νόμος που διέπει </h2><p>Αυτοί οι Όροι και η χρήση των Υπηρεσιών από εσάς θα διέπεται και θα ερμηνεύεται σύμφωνα με τους νόμους της Ελβετίας και τυχόν διαφορές θα επιλύονται στα δικαστήρια της Βασιλείας, Ελβετία. </p><h2>Αλλαγές στους Όρους </h2><p>Ο Όμιλος διατηρεί το δικαίωμα να αλλάξει αυτούς τους Όρους ανά πάσα στιγμή, και εσείς φέρετε την ευθύνη για τον περιοδικό έλεγχο αυτών των Όρων για τυχόν αλλαγές. Η συνέχιση της χρήσης των Υπηρεσιών μετά την πραγματοποίηση τυχόν αλλαγών στους Όρους θα συνιστά αποδοχή των αναθεωρημένων Όρων.</p><p><br></p>",
