  "about_content": "<h2>Σχετικά με αυτή την εφαρμογή</h2>\n<p>Αυτή η εφαρμογή σας παρέχεται από την PharmaLedger®. Αναπτύχθηκε από κοινού από οργανισμούς που εκπροσωπούν ασθενείς, φαρμακευτικές εταιρείες και ειδικούς της τεχνολογίας.</p><p>Επιτρέπει στους χρήστες της εφαρμογής να βλέπουν πληροφορίες για το φάρμακό τους σαρώνοντας τον γραμμωτό κώδικα επάνω στη συσκευασία του προϊόντος.</p><p>Οι πληροφορίες που εμφανίζονται παρέχονται από τον Κάτοχο της Άδειας Κυκλοφορίας του προϊόντος.</p><h2>Σχετικά με την PharmaLedger</h2><p>PharmaLedger® είναι η επωνυμία του Ομίλου PharmaLedger(PLA).</p><p>Ο PLA είναι ένας παγκόσμιος μη κερδοσκοπικός όμιλος. Σκοπός του Ομίλου είναι να δημιουργήσει και να προωθήσει ένα ψηφιακό οικοσύστημα εμπιστοσύνης στην υγειονομική περίθαλψη.</p><p>Ο Όμιλος προωθεί τη συνεργασία στους τομείς της υγείας και της βιο- επιστήμης και προωθεί τις καινοτομίες και την εφαρμογή τους προς αμοιβαίο όφελος των ασθενών και άλλων ενδιαφερομένων.</p>",
  "help_modal_title": "Βοήθεια",
  "help_modal_subtitle": "Συχνές ερωτήσεις",
  "help_content": "<div><p><b><h2>Τι είναι το ΗΠΠ; </h2></b></p><p> <b>Το ΗΠΠ</b> είναι μια συντόμευση του όρου <b>ηλεκτρονικές πληροφορίες προϊόντος.</b> Είναι μια ηλεκτρονική έκδοση του τυπωμένου Φύλλου Οδηγιών Χρήσης ενός φαρμάκου που συνήθως βρίσκεται εντός της συσκευασίας του φαρμακευτικού προϊόντος. Σε μερικές περιπτώσεις, το <b>ΗΠΠ</b> μπορεί να έχει αντικαταστήσει το τυπωμένο Φύλλο Οδηγιών Χρήσης. </p><p><b><h2>Τι είναι η PharmaLedger; </h2></b></p><p>Ο Όμιλος PharmaLedger (PLA) είναι ένας μη-κερδοσκοπικός όμιλος με έδρα την Ελβετία με σκοπό την ενεργοποίηση και προώθηση ενός Οικοσυστήματος Ψηφιακής Εμπιστοσύνης στην υγειονομική περίθαλψη μέσω μιας τυποποιημένης και αξιόπιστης πλατφόρμας ανοιχτού κώδικα. Η PLA προωθεί τη συνεργασία και επιταχύνει την καινοτομία και την υιοθέτηση για την επίτευξη αμοιβαίων οφελών στους τομείς της υγειονομικής περίθαλψης και της επιστήμης της ζωής για τους ασθενείς και άλλους ενδιαφερόμενους φορείς. Η PLA ιδρύθηκε το 2022 για να συνεχίσει το έργο του σχεδίου PharmaLedger, ενός τριετούς έργου που χρηματοδοτείται από την Ευρωπαϊκή Επιτροπή και τη φαρμακοβιομηχανία με στόχο να αποδείξει την αξία των λύσεων blockchain. Περισσότερες πληροφορίες είναι διαθέσιμες στο https://pharmaledger.org.</p><p><b><h2>Τι είναι το DataMatrix?</h2></b></p><p>Είναι ένας τύπος γραμμικού κώδικα στη συσκευασία του προϊόντος σας. Είναι ένας ασπρόμαυρος τετράγωνος γραμμωτός κώδικας και μοιάζει με αυτόν: <br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Πώς να χρησιμοποιήσετε την εφαρμογή; </h2></b></p><p>Ακολουθήστε τις οδηγίες στην αρχική σελίδα της <b>Εφαρμογής…</b> δείχνει μια εικόνα του που να βρείτε το <b>DataMatrix</b> στη συσκευασία του Προϊόντος σας. Μόλις βρείτε το <b>DataMatrix</b>, πατήστε το κουμπί Σάρωση <b>DataMatrix</b>'. Επιτρέψτε στην εφαρμογή να χρησιμοποιήσει την κάμερα έτσι ώστε το <b>DataMatrix</b> να μπορεί να σαρωθεί. Χρησιμοποιήστε την κάμερα για να εστιάσετε στο <b>DataMatrix</b>. Μόλις η συσκευασία σαρωθεί επιτυχώς, το <b>EPI</b> θα εμφανιστεί. Μπορείτε να πατήσετε το κουμπί ‘+’ για να δείτε περισσότερες πληροφορίες.</p><p><b><h2>Γιατί δε δίνει κάποιο αποτέλεσμα η σάρωση του DataMatrix;</h2></b></p><p>Υπάρχουν πολλοί λόγοι ως προς το γιατίτο <b>DataMatrix</b> στη συσκευασία σας μπορεί να μην δίνει ένα ΗΠΠ. Ένας από τους λόγους θα μπορούσε να είναι η εστίαση της κάμερας. Παρακαλούμε προσπαθήστε να σαρώσετε τον κωδικό σε ένα καλώς φωτισμένο χώρο ώστε ο κωδικός κα φαίνεται καθαρά στην οθόνη. Αν δεν καταφέρνετε να κρατήσετε το χέρι σας σταθερό, μπορείτε να δοκιμάσετε να χρησιμοποιήσετε ένα τραπέζι για να στηρίξετε τα χέρια σας.</p></div>",
